import React from "react";
import "./ScheduleTable.css";

const ScheduleTable = ({ schedule, title }) => {
  return (
    <div className="schedule-table-container">
      <h2>{title}</h2>
      {schedule.length === 0 ? (
        <p>Nu există date disponibile pentru afișare.</p>
      ) : (
        <table className="schedule-table">
          <thead>
            <tr>
              <th>Zi</th>
              <th>Interval</th>
              <th>Disciplina</th>
              <th>Tip</th>
              <th>Profesor</th>
              <th>Sala</th>
              <th>Frecvență</th>
            </tr>
          </thead>
          <tbody>
            {schedule.map((entry, index) => (
              <tr key={index}>
                <td>{entry.zi}</td>
                <td>
                  {entry.oraStart} - {entry.oraEnd}
                </td>
                <td>{entry.disciplina}</td>
                <td>{entry.tip}</td>
                <td>{entry.profesor}</td>
                <td>{entry.sala}</td>
                <td>{entry.frecventa || "-"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default ScheduleTable;
